import React from 'react';
import ReactDOM from 'react-dom'


let date=new Date(2022,1,1,20);
let time;
let hours=date.getHours();
let styleCSS={};

if(12>=hours && 23>hours){
    time="good morning";
    styleCSS={
        color:"red"
    }
}else if(18>=hours && 13<=hours){ 
    time="good evening";
    styleCSS={
        color:"green"
    }
}else if(23<hours && 19>hours){
    time="good night";
    styleCSS={
        color:"blue"
    }
}else{
    time="system error";
    styleCSS={
        color:"yellow"
    }
};


ReactDOM.render(
<div> 
    <h1 style={styleCSS} >{time}</h1>  
</div>, 
document.getElementById("root"));
